const Wrapper = styled.div`
`;

export default function PostsPage({ posts }) {
  console.log(posts);
  return (
    <Wrapper>
      {posts.map(({ key, value }) => <PostItem key={key} {...value} />)}
    </Wrapper>
  );
}
